Polres Metro Bekasi Kota yang bertempat di Kelurahan Harapanmulya, Kecamatan Medansatria, Kota Bekasi mengalami serangan dari sekelompok orang tak dikenal pada hari Minggu 31 Agustus 2025.

Namun, lurah dan camat aktif memberi himbauan kepada warga masyarakat dan hadir membersamai warga disekitar lokasi kejadian untuk mengingatkan warga agar tidak terprovokasi melakukan tindakan perusakan dan penjarahan terhadap fasilitas - fasilitas umum. Warga Kelurahan Harapanmulya merespon dengan melakukan aksi jaga kampung dengan memblokade jalan-jalan masuk perkampungan dan perumahan serta melakukan perlawanan agar pelaku kerusuhan tidak bersembunyi serta melakukan perusakan fasilitas umum di wilayah Kelurahan Harapanmulya.

Unjuk rasa hak setiap warga negara. Bagus untuk demokrasi. Tapi anarkis bukan demokrasi. Justru rugikan rakyat. #jagaharmul #jagabekasi jaga rumah kita bersama.

