[Kemeriahan Lomba Gerak Jalan Sehat Ceria 2025]

Dalam rangka menyambut HUT Kemerdekaan Republik Indonesia ke-80, Kecamatan Medansatria menyelenggarakan Gerak Jalan Sehat Ceria yang berlokasi di Danau Indah Kalibaru, Kelurahan Kalibaru.

Acara dibuka dengan penuh semangat oleh Camat Medansatria, Bapak Widy Tiawarman, yang menyampaikan sambutan serta harapan besar agar kegiatan ini dapat mempererat persatuan, menumbuhkan semangat kebersamaan, dan menghadirkan keceriaan bagi masyarakat.

🎉 Kemeriahan semakin terasa dengan berbagai rangkaian kegiatan, di antaranya:
👟 Lomba Gerak Jalan Sehat Ceria
🛍️ Pameran UMKM
🩺 Tes Kesehatan Gratis
📑 Pelayanan Adminduk
💍 Pelayanan KUA
🏆 Penyerahan Hadiah Pemenang Lomba
📜 Pemberian Surat Tanah Program PTSL dari Badan Pertanahan

Turut hadir seluruh Aparatur Kecamatan Medansatria serta masyarakat yang dengan antusias ikut memeriahkan dan menyukseskan acara ini.

Semoga semangat kemerdekaan selalu terjaga dan kebersamaan ini menjadi kekuatan bagi kita semua.

