Lurah Harapanmulya mengucapkan Dirgahayu Republik Indonesia yang ke 80 

Delapan dekade lalu, tepat 17 Agustus 1945, proklamasi kemerdekaan Indonesia menggema di seluruh nusantara. Kini, saat kita merayakan Hari Ulang Tahun ke-80 Republik Indonesia 2025, gema itu kembali terasa. Bukan lagi sekadar pekik perjuangan fisik, melainkan panggilan jiwa untuk memaknai arti kemerdekaan yang sesungguhnya.

Memberikan ucapan selamat HUT ke-80 RI bukan hanya tradisi tahunan, tetapi juga wujud rasa syukur, penghormatan pada para pahlawan, dan doa untuk masa depan bangsa. Dalam setiap kata, tersimpan semangat persatuan, pengingat akan perjuangan, dan komitmen untuk mengisi kemerdekaan dengan karya nyata.

